(5 ,"Gilbert McQueen Park", "650 W Lake Mann Drive", "Orlando", "FL", "32805", "-81.4229191", "28.5328987", "Gilbert McQueen Park is named in honor of the first African-American from Orlando killed in the Korean War. The park has a grilling area, playground and other amenities for visitors to enjoy.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
