(5 ,"Heroes Community Park", "14028 Centerline Drive", "Orlando", "FL", "32827", "-81.26765180000001", "28.362162", "Heroes Community Park is across the water from the Veterans Affairs Hospital and around the corner from Laureate Park Elementary School. Among the amenities for residents to enjoy are four multiuse fields lit for night activities.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
