(5 ,"LeRoy Hoequist Park", "1450 S Alder Avenue", "Orlando", "FL", "32807", "-81.2976448", "28.5254545", "LeRoy Hoequist Park has a playground, picnic tables and lakeside views for visitors to enjoy.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
