(5 ,"Loch Haven Park", "777 E Princeton Street", "Orlando", "FL", "32803", "-81.368545", "28.571671", "Loch Haven Cultural Park covers 45 acres and serves as the region?s premier cultural park. Nestled between three lakes, Lake Estelle on the north, Lake Rowena on the east and Lake Formosa on the south, the park is located on North Mills Avenue and Princeton Street.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
