(5 ,"Orlando Skate Park", "400 Festival Way", "Orlando", "FL", "32803", "-81.3467308", "28.5482349", "The Orlando Skate Park has a variety of outdoor courses for skateboarders, from beginner to advanced levels.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Orlando Southeast Trail", "Southeast Trail", "Orlando", "FL", "32827", "-81.25695739999999", "28.4322955", "The Orlando Southeast Trail is located east of the Orlando International Airport near Narcoossee Road, twenty miles from Downtown Orlando. The trail is approximately thirteen miles long.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Orlando Tennis Centre", "649 West Livingston Street", "Orlando", "FL", "32801", "-81.38830800000001", "28.547834", "The Orlando Tennis Centre offers lighted clay and hard tennis courts for tennis players of all skill levels to enjoy.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Orlando Urban Trail", "Orlando Urban Trail", "Orlando", "FL", "32803", "-81.3733975", "28.5603867", "The Orlando Urban Trail is located near Downtown Orlando and is considered the spine of Orlando?s trail network. The trail is approximately three miles long", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Orlando Veterans? Memorial Park", "2380 Lake Baldwin Ln", "Orlando", "FL", "32814", "-28.577607535071593", "-81.3239475395031", "Orlando Veterans? Memorial Park was created in honor of our military veterans and their contribution to the citizens of the United States.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Orlando Wetlands Park", "25155 Wheeler Road", "Christmas", "FL", "32709", "-80.9933896", "28.569518", "The Orlando Wetlands Park is a man-made wetland designed to provide advanced treatment for reclaimed water from the City of Orlando and other local cities. The Park is 1650 acres in size and located in Christmas, Florida. Visitors may enjoy primitive and passive activities at the Park. Hours are sunrise to sunset, 365 days of the year.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
