(5 ,"Poppy Park", "5344 Lescot Lane", "Orlando", "FL", "32811", "-81.4513674", "28.5233491", "Poppy Park is located in the Carver Shores neighborhood on the west side of Orlando. It has a playground, grilling area and other amenities for visitors to enjoy.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
