(5 ,"Southport Community Park", "3437 Barnstable Place", "Orlando", "FL", "32827", "-81.3401172", "28.4434619", "A former Navy recreation area, Southport Community Park is a showcase recreation center for southeast Orlando. Consisting of 52 acres, the site was developed into multiple athletic fields including baseball diamonds and a softball field as well as picnic and playground areas, walking paths and other amenities.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
