(5 ,"The Terrace Gallery", "400 South Orange Avenue", "Orlando", "FL", "32801", "-81.3796806", "28.5376214", "The Terrace Gallery reflects the city?s dedication to the arts and it provides a space where visual artists can share their insight with the community.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Trotters Park", "2701 Lee Road", "Orlando", "FL", "32789", "-81.41448249999999", "28.5992605", "Trotters Park is one of the City?s four cornerstone parks. Originally the home of the Ben White Raceway, the site?s facilities reflect that historical equestrian theme. The park has soccer fields, baseball fields, restroom and concession facilities, biking and blading trails.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Turkey Lake Pool", "3401 South Hiawassee Road", "Orlando", "FL", "32835", "-81.48389209999999", "28.5070975", "3401 South Hiawassee RoadOrlando, FL 32835", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
(5 ,"Wadeview Neighborhood Center", "2177 Summerlin Avenue", "Orlando", "FL", "32806", "-81.3691571", "28.5177196", "One of Orlando?s most popular neighborhood parks, Wadeview Park is located among pines, cypress and oak trees, making it perfect for picnics and family gatherings.  The park offers 5 picnic pavilions, playground, parking lot, restroom and exercise trail.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
