(5 ,"Z.L. Riley Park", "719 South Parramore Avenue", "Orlando", "FL", "32805", "-81.3887132", "28.5340528", "Z.L. Riley Park is a gem in the heart of Parramore. Children can enjoy the colorful playground while their families relax in the open green spaces or prepare picnics with the grills. Z.L. Riley Park can accommodate special events with its unique large pavilion which can be used as a stage, wide sidewalk, and spaces and utility hookups for vendor areas.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory", "2", 52),
# Historic trees
(5 ,"Historic Trees at Langford Park", "1808 E Central Boulevard", "Orlando", "FL", "32802", "-81.35760105999013", "28.54202201370151", "A natural refuge near Downtown Orlando, Mayor Carl T. Langford Park is filled with large Shumard Oak, Swamp Chestnut, Laurel and Live Oak trees.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Orlandos-Significant-Trees#section-1", "5", 51),
(5 ,"Historic Trees at Dickson Azalea Park", "100 Rosearden Drive", "Orlando", "FL", "32803", "-81.35845155549411", "28.544656242359153", "Around 100 years old, the Long Leaf Pine trees at Dickson Azalea Park are extremely tall because they need to be taller than the Oak trees alongside the ravine in which they grow.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Orlandos-Significant-Trees#section-1", "5", 51),
(5 ,"Historic Trees at Constitution Green Park", "300 S Summerlin Avenue", "Orlando", "FL", "32801", "-81.36940155226132", "28.538811864956593", "The big Live Oak at Constitution Green Park in Downtown Orlando is probably 125-175 years old. The tree has recumbent branching on one side, with branches touching the ground. There was another tree on the opposite side and as a result, crown adaptation  forcing the growth of branches in other directions  has occurred.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Orlandos-Significant-Trees#section-1", "5", 51),
(5 ,"Historic Trees at Lake Eola Park", "512 East Washington Street", "Orlando", "FL", "32801", "-81.3737452391069", "28.542347577846073", "Large Live Oak trees line Lake Eola Park along Central Boulevard. The trees help provide ample shade throughout the Citys most popular park.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Orlandos-Significant-Trees#section-1", "5", 51),
(5 ,"Historic Trees at Big Tree Park", "930 N Thornton Avenue", "Orlando", "FL", "32803", "-81.36572894814299", "28.55809805864512", "Likely between 350 and 400 years old, the oldest tree in Orlando is located at Big Tree Park. Live Oaks can live for centuries.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Orlandos-Significant-Trees#section-1", "5", 51),
(5, "Historic Trees at Harry P. Leu Gardens", "1920 North Forest Avenue", "Orlando", "FL", "32803", "-81.35709646989906", "28.56692474300885", "A 50-acre botanical oasis, Leu Gardens features an alle of huge Camphor trees. Native to China and Japan, Camphor trees were introduced into Florida in 1875 and are able to displace native trees and plants.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Orlandos-Significant-Trees#section-1", "5", 51),
(5 ,"Historic Trees at Loch Haven Park", "777 E Princeton Street", "Orlando", "FL", "32803", "-81.36619538731698", "28.571981917010554", "Over 200 years old, The Mayor, is a Live Oak at Loch Haven Park that has survived despite limb breaks in 2008 and 1998.", "<img src='https://github.com/EthanNValencia/EcoMapImageRepo/blob/master/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Orlandos-Significant-Trees#section-1", "5", 51),
# Urban farms
(6 ,"South Street Farm by Infinite Zion Farms", "626 W South St", "Orlando", "FL", "32805", "-81.3877621891108", "28.538178212188114", "Zion Farms & Market is a 501 (c)(3) non-profit organization. We operate an urban farmer collective as Infinite Zion Farms. Our mission is to provide access to organic produce to our community. Through gardening urban youth are also able to experience nature in a way they likely have not before. Kids and adults alike can join us and learn about basic agriculture education, environmental protection and sustainability.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/infinitezionfarms.png?raw=true' /><br /><br />", "http://www.infinitezionfarms.org", "2", 63),
(6 ,"Fleet Farming", "1030 Kaley Ave", "Orlando", "FL", "32805", "-81.39419300247224", "28.519901114644465", "Fleet Farming is a non-profit urban agriculture program of IDEAS For Us that transforms the average American lawn into a bio-verse, productive micro farms and edible gardens. Our mission is to empower all generations to grow food to increase local food accessibility.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/fleetfarming.png?raw=true' /><br /><br />", "https://fleetfarming.org/", "2", 63),
(6 ,"4 Roots Co-Op", "1918 W Princeton St", "Orlando", "FL", "32804", "-81.40835512714447", "28.570899820336038", "4Roots is an alliance of community stakeholders investing in a healthy thriving, sustainable, food system. Our key initiative is the 4Roots Farm Campus which is being developed in the heart of Orlando to serve as a community crossroads where individuals and organizations can work together to build solutions for a better food future.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/4roots.png?raw=true' /><br /><br />", "https://www.4rootsfarm.org/", "2", 63),
(6 ,"Southern Urban Gardens of Central Florida", "3710 Hargill Dr", "Orlando", "FL", "32806", "-81.3378563997036", "28.527510305582997", "Southern Urban Gardens is a sustainable, environmentally-friendly urban farm  owned by Ralph Holweck and Gail Tyree.  The urban farm specializes in 'dirt' farming and 'aeroponic' hydroponics in Orlando. We grow microgreens, leafy greens, edible flowers and herbs hydroponically in food grade containers with purified water.  We use no chemicals or pesticides.  Also, grow tubuler-like radishes and beets, and, vine-like plants like tomatoes and green peppers in our 'dirt' garden area. We are a small commercial grower in Central Florida and have sufficient growing capacity to customize orders for local restaurants, caterers,  and retail sales where people want to eat clean food.  We train many individual and small  commercial growers nationwide for the growing of microgreens and leafy greens; and, we sell the leafy greens and microgreen hydroponic growing capabilities. Excellent customer service with dependable deliveries and we stand behind everything we do.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/southernurbangardens.png?raw=true' /><br /><br />", "https://southernurbangardens.com", "2", 63),
