# "bike trails"
INSERT INTO ecomap.locations (`iconid`, `name`, `street`, `town`, `state`, `zip`, `longitude`, `latitude`, `content`, `thumbnail`, `link`, `api`, `sub_pillar_id`) VALUES

(3 , "Cady Way Trail - Bike Trailhead", "821 Herndon av", "ORLANDO", "FL", "32803", "-81.3362368", "28.5570433", "The Cady Way Trail is located four miles northeast of Downtown Orlando and is one section of a larger regional trail.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory/Cady-Way-Trail", "4", 32),
(3 , "Lake Underhill Path - Bike Trailhead", "201 Andes Avenue", "ORLANDO", "FL", "32807", "-81.3176604", "28.5408909", "The Lake Underhill Path is located three miles east of Downtown Orlando adjacent to the Orlando Executive Airport.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory/Lake-Underhill-Path", "4", 32),
(3 , "Orlando Southeast Trail - Bike Trailhead", "14028 Centerline Drive", "ORLANDO", "FL", "32827", "-81.2684098", "28.361795", "The Orlando Southeast Trail is located east of the Orlando International Airport near Narcoossee Road, twenty miles (20) from Downtown Orlando. The trail is approximately thirteen miles long and twelve feet wide.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory/Orlando-Southeast-Trail", "4", 32),
(3 , "Orlando Urban Trail - Bike Trailhead", "N Magnolia Ave", "ORLANDO", "FL", "32804", "-81.3774111", "28.5596727", "The Orlando Urban Trail is located near Downtown Orlando and is considered the spine of Orlandos trail network.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory/Orlando-Urban-Trail", "4", 32),
(3 , "Shingle Creek Trail - Bike Trailhead", "5165 Metrowest Boulevard", "ORLANDO", "FL", "32811", "-81.4519102", "28.5171002", "The Shingle Creek Trail is a regional multi-use trail that once completed will connect the City of Orlando, Orange County, Osceola County and the City of Kissimmee.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory/Shingle-Creek-Trail", "4", 32);

# "Wetlands Park"
INSERT INTO ecomap.locations (`iconid`, `name`, `street`, `town`, `state`, `zip`, `longitude`, `latitude`, `content`, `thumbnail`, `link`, `api`, `sub_pillar_id`) VALUES

(2, "Orlando Wetlands Park ", "25155 Wheeler Road", "Christmas", "FL", "32709", "-80.9955783", "28.569518", "The Orlando Wetlands Park is a man-made wetland designed to provide advanced treatment for reclaimed water from the City of Orlando and other local cities. The Park is 1650 acres in size and located in Christmas, Florida. Visitors can visit the Park seven days a week, between sunrise and sunset, to enjoy primitive and passive activities.", "<img src='https://github.com/MattDrennan/GreenworksMap/blob/master/EcoMap/src/main/webapp/images/cityorlando.png?raw=true' /><br /><br />", "https://www.orlando.gov/Parks-the-Environment/Directory/Wetlands-Park", "4", 22);

